// Nav.js
import './Nav.css'; // Opcional: Archivo de estilos para el componente Nav
import React from 'react';

function Nav() {
  return (  
  <nav class="navbar navbar-default navbar-fixed-top navbar-shrink">
    <div class="container">
      <a class="navbar-brand page-scroll" href="#page-top">
        <svg width="30" height="30" viewBox="0 0 30 30" fill="none" xmlns="http://www.w3.org/2000/svg">
          <rect x="2" y="2" width="26" height="26" rx="5" fill="#808080"/>
          <circle cx="10" cy="10" r="4" fill="none" stroke="#00FFFF" stroke-width="2"/>
          <polygon points="20,5 27,15 13,15" fill="none" stroke="#00FFFF" stroke-width="2"/>
          <rect x="7" y="18" width="6" height="4" fill="none" stroke="#00FFFF" stroke-width="2" transform="rotate(15 10 20)"/>
        </svg>
        Daniel Prisco
      </a>
      <div class="collapse navbar-collapse" id="bs-example-navbar-collapse-1"></div>
    </div>
  </nav>
  );
}

export default Nav;
